import './Header.css';

function Header() {
    
  return (
    <header>
      <h1>My ReactJS Header</h1>
      <nav>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
